import React, { useState } from 'react';
import { Table } from 'reactstrap';

const TableItem = (data) => {
    const [colNames, setColNames] = useState()
    return (
        <div className="TableITem">
            <h1>Table</h1>
            <Table>
                <thead>
                    <tr>
                        <th>#</th>
                        {data.data.map(item => <th>{item.title}</th>)}
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <th></th>
                    </tr>
                </tbody>
            </Table>
        </div>
    )
}

export default TableItem;
